import React from 'react';

const Cards = ({ people }) => {
	return(
		<div>
			<h1>{ people.name }</h1>
			<h2>{ people.height }</h2>
			<h2>{ people.mass }</h2>
			<h2>{ people.hair_color }</h2>
			<h2>{ people.skin_color }</h2>
			<h2>{ people.eye_color }</h2>
			<h2>{ people.birth_year }</h2>
			<h2>{ people.gender }</h2>
		</div>	

	)
}

export default Cards;
